When people took to the streets in the autumn of 1989, they risked their own freedom to achieve freedom for all. 
People healed a European continent divided by war.
@JunckerEU on the 30th anniversary of the Peaceful Revolution 9 November 1989: https://t.co/9SVtyxH6rj #mauerfall30 https://t.co/emlbX4u4dB

@GOettingerEU @EU_Budget Some countries get discounts on their payments to the EU budget for historical reasons. This is not fair for the others. 
If we get rid of these discounts, everybody would be paying the same – much fairer for all. 
#EUBudget https://t.co/1uSk0uchFD

@GOettingerEU @EU_Budget It is only normal that in the next seven-year budget, national contributions increase – just like they do for national budgets. 
This is mainly because of inflation and economic growth just like in national budgets.
#EUBudget https://t.co/cf52gOpbCg

@GOettingerEU @EU_Budget Commission proposal for the EU’s next seven-year budget is already smaller than the current budget: 1.114% of GNI vs 1.16% of GNI at present.
If we want money for research, climate change, young people, there is no room for further cuts.
#EUBudget https://t.co/uwFOeqIPbB
